import React from 'react'
import { useSelector } from 'react-redux'

const Preview = (props) => {
  const user = useSelector(state => state.login)
  if (!user) {
    return null
  } else {
    return (
      <div><h1>blogs</h1>{props.name} has logged in <button onClick={props.handleLogout}>LogOut</button></div>
    )
  }
}

export default Preview
